import React from 'react';
import logo from './portfolioImg.jpeg';
import './App.css';

const background = "./background.jpeg"; 

function App() {
  return (
    <div className="App">
      <div className="Background-Image"
        style={{
          backgroundImage: 'url(' + background + ')',
          backgroundSize: "cover",
          backgroundPosition: "center center",
          backgroundRepeat: "no-repeat"
        }}>
        </div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Jacqueline Gwynn</h1>
        <p>
          Hello, I am a Full Stack Engineer with a background in finance
          industry and a passion for providing the best user experience.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn More About Me
        </a>
      </header>
    </div>
  );
}

export default App;
